import logo from "./logo.svg";
import "./App.css";
import { ReactComponent as Logo } from "./assets/logos.svg";
import { useState } from "react";

function App() {
  const [email, setEmail] = useState('')
    const [password, setPassword] = useState("");

	return (
		<div className="bg-[#19173D] min-h-screen ">
			<div className="bg-[#262450] w-full py-2 px-5">
				<Logo width={48} />
			</div>
				<div className="bg-[#262450] text-white w-full md:w-24 md:min-w-96 mid:min-h-96 min-h-64  flex justify-center items-center rounded-2xl  ">
					<div className="w-full px-10">
						<label
							for="about"
							className="block text-sm font-medium leading-6 text-white"
						>
							Email
						</label>
						<div className="mt-2 mb-3">
							<input
								id="about"
								name="about"
								rows="3"
								value={email}
								onChange={(e) => setEmail(e.target.value)}
								className="block w-full rounded-md focus:outline-none border-0 py-2  text-white bg-[#19173D] shadow-sm  sm:text-sm sm:leading-6 "
							/>
						</div>
						<div >
							<label
								for="about"
								className="block text-sm font-medium leading-6 text-white "
							>
								Password
							</label>
							<div className="mt-2">
								<input
									rows="3"
									value={password}
									onChange={(e) => setPassword(e.target.value)}
									className="block w-full rounded-md px-3  focus:outline-none border-0 py-2  text-white bg-[#19173D] shadow-sm  sm:text-sm sm:leading-6 "
								/>
							</div>
						</div>
					</div>
				</div>
		</div>
	);
}

export default App;
